n_qubits = 155
n_stabilizers = len(stabilizer_strings_all)

print(f"Number of qubits: {n_qubits}")
print(f"Number of generators: {n_stabilizers}")

# Convert to stim.PauliString
all_stabs = []
for s in stabilizer_strings_all:
    all_stabs.append(stim.PauliString(s))

# Look at the anticommuting stabilizers more closely
print("\nAnalyzing anticommuting stabilizers...")
problem_stabs = [8, 78, 103, 113, 128, 143]
for idx in problem_stabs:
    print(f"\nStabilizer {idx}:")
    s = stabilizer_strings_all[idx]
    # Find X and Z positions
    x_pos = [i for i, c in enumerate(s) if c == 'X']
    z_pos = [i for i, c in enumerate(s) if c == 'Z']
    print(f"  X positions: {x_pos}")
    print(f"  Z positions: {z_pos}")

# Let's see if we can multiply to make them commute
# Stab 8 anticommutes with 78, 103, 113, 128, 143
# Let's try multiplying stab 8 with another stabilizer that will fix the anticommutation
print("\n\nTrying to modify stabilizer 8...")
stab8 = all_stabs[8]
print(f"Stabilizer 8: X at {[i for i, c in enumerate(stabilizer_strings_all[8]) if c == 'X']}")
print(f"Stabilizer 78: Z at {[i for i, c in enumerate(stabilizer_strings_all[78]) if c == 'Z']}")

# Check what happens when we multiply
for candidate_mult in [3, 7, 9]:  # Try some nearby stabilizers
    new_stab = stab8 * all_stabs[candidate_mult]
    all_commute = True
    for test_idx in [78, 103, 113, 128, 143]:
        if not new_stab.commutes(all_stabs[test_idx]):
            all_commute = False
            break
    if all_commute:
        print(f"Multiplying stab 8 by stab {candidate_mult} fixes all anticommutations!")
        break

# The anticommutation pattern suggests these are logical operators
# Let's check if 78, 103, 113, 128, 143 are related to 150, 151, 152, 153
print("\nChecking structure of last 4 stabilizers...")
for i in range(150, 154):
    print(f"Stab {i}: X at {[j for j, c in enumerate(stabilizer_strings_all[i]) if c == 'X']}")
    print(f"       Z at {[j for j, c in enumerate(stabilizer_strings_all[i]) if c == 'Z']}")

# Try different excluded sets to maximize the number of stabilizers satisfied
print("\n\nSearching for best maximal commuting subset...")

best_selection = None
best_count = 0

# Try excluding each of the problem indices one at a time
for exclude_idx in [8, 78, 103, 113, 128, 143]:
    selected = []
    for i in range(154):
        if i == exclude_idx:
            continue
        can_add = True
        for j in selected:
            if not all_stabs[i].commutes(all_stabs[j]):
                can_add = False
                break
        if can_add:
            selected.append(i)
    
    print(f"Excluding {exclude_idx}: got {len(selected)} commuting stabilizers")
    if len(selected) > best_count:
        best_count = len(selected)
        best_selection = selected

print(f"\nBest: {best_count} stabilizers when excluding {set(range(154)) - set(best_selection)}")

# Generate circuit from best selection
test_stabs = [all_stabs[i] for i in best_selection]
try:
    tableau = stim.Tableau.from_stabilizers(test_stabs, allow_underconstrained=True, allow_redundant=True)
    circuit = tableau.to_circuit(method='elimination')
    print(f"Circuit generated with {len(circuit)} operations")
    with open("circuit_155.stim", "w") as f:
        f.write(str(circuit))
    print("Circuit saved to circuit_155.stim")
except Exception as e:
    print(f"Error: {e}")
